import React from "react";
import { Box, Flex, Image, Button } from "rebass";
// import logo from "../static/ftwllogo.png";
import "./Navbar.css";

function Navbar() {
  return (
    <div className="Navbar" style={styles}>
      <Box p={5} fontSize={4} width={[1, 1, 1]} color="black" bg="blue">
        <Flex>
          <Box
            p={5}
            fontSize={2}
            width={[1 / 8, 1 / 8, 1 / 8]}
            height={[1 / 16, 1 / 16, 1 / 16]}
            color="black"
            bg="gray"
          >
            <Image src={"../static/ftwllogo.png"} width={400} height={400} />
          </Box>
          <Box
            p={5}
            fontSize={2}
            width={[1 / 8, 1 / 8, 1 / 8]}
            height={[1 / 16, 1 / 16, 1 / 16]}
            color="black"
            bg="white"
          >
            About Us
          </Box>
          <Box
            p={5}
            fontSize={2}
            width={[1 / 8, 1 / 8, 1 / 8]}
            height={[1 / 16, 1 / 16, 1 / 16]}
            color="black"
            bg="yellow"
          >
            Ways to Give
          </Box>
          <Box
            p={5}
            fontSize={2}
            width={[1 / 8, 1 / 8, 1 / 8]}
            height={[1 / 16, 1 / 16, 1 / 16]}
            color="black"
            bg="orange"
          >
            Found an Animal?
          </Box>
          <Box
            p={5}
            fontSize={2}
            width={[1 / 8, 1 / 8, 1 / 8]}
            height={[1 / 16, 1 / 16, 1 / 16]}
            color="black"
            bg="red"
          >
            News & Events
          </Box>
          <Box
            p={5}
            fontSize={2}
            width={[1 / 2, 1 / 2, 1 / 2]}
            height={[1 / 16, 1 / 16, 1 / 16]}
            color="black"
            bg="green"
          >
            <Flex>
              <Image src={"../static/Facebookicon.png"} variant="avatar" />
              <Image src={"../static/Instagramicon.png"} variant="avatar" />
              <Image src={"../static/Twittericon.png"} variant="avatar" />
            </Flex>
            <Flex>
              <Button variant="primary" mr={2}>
                Donate
              </Button>
              <Button variant="secondary" mr={2}>
                Contact Us
              </Button>
            </Flex>
          </Box>
        </Flex>
      </Box>
    </div>
  );
}

export default Navbar;

const styles = {
  "background-color": "white",
  "text-color": "black"
};
